import React from 'react';
import Contact from './contact.png'
import digital from './digital.png'
import './contact.css'


function contact() {
    return (
        <div className="Contactcontainer">
        <div className="ContactTitle">
            <img src={Contact}/>

         
           
        
        </div>
        <h4>Contact Us</h4>
       

   </div>
 
      
  
    );
}

export default contact;
